        public static List<string> GetAllRegionName()
        {
            if (regionDictionary.Count > 0)
            {
                return regionDictionary.Keys.ToList();
            }
            return null;
        }

        public static GMapPolygon CreateMapPolygon(string name)
        {
            if (regionDictionary.ContainsKey(name))
            {
                string regionPoints = regionDictionary[name];
                string[] pairPoints = regionPoints.Split(';');
                List<PointLatLng> pointList = new List<PointLatLng>();
                foreach (var points in pairPoints)
                {
                    string[] point = points.Split(',');
                    if (point.Length == 2)
                    {
                        PointLatLng p = new PointLatLng(double.Parse(point[1]), double.Parse(point[0]));
                        pointList.Add(p);
                    }
                }
                GMapPolygon polygon = new GMapPolygon(pointList, name);
                polygon.Fill = new SolidBrush(Color.FromArgb(0, Color.White));
                return polygon;
            }
            else
            {
                return null;
            }
        }

        public static RectLatLng GetRegionMaxRect(GMapPolygon polygon)
        {
            double latMin = 90;
            double latMax = -90;
            double lngMin = 180;
            double lngMax = -180;
            foreach (var point in polygon.Points)
            {
                if (point.Lat < latMin)
                {
                    latMin = point.Lat;
                }
                else if (point.Lat > latMax)
                {
                    latMax = point.Lat;
                }
                else if (point.Lng < lngMin)
                {
                    lngMin = point.Lng;
                }
                else if (point.Lng > lngMax)
                {
                    lngMax = point.Lng;
                }
            }

            return new RectLatLng(latMax, lngMin, lngMax - lngMin, latMax - latMin);
        }
    }
